import React from "react";

const Head = () => {
  return (
    <>
      <section className="head">
        <div className="container flexSB padding10">
          <div className="logo">
            <img src="/images/logo.png" alt="" />
          </div>
          <div className="ad">
            <img src="/images/banner.png" alt="" />
          </div>
        </div>
      </section>
    </>
  );
};

export default Head;
